const FormInput = ( props ) => {

    var inputType;

    switch (props.type) {
        case "input":
            inputType = 
            <div>
                <input className='FormInput' placeholder={props.placeholder}/>
            </div>
            break;
        case "select":
            inputType =
            <div>
                <select>

                </select>
            </div>
    }


    return (
        <div>
            {inputType}
        </div>
    )
}

export default FormInput
